@AnaTeresaCruzG1 No es una indirecta. Mi mamá dice: nos vamos de vacaciones. Yo digo, que padre mami, buen viaje.
Mi hermano dice, en tal aerolinea no vuelen, si se van a ir por carretera no tomen ese camino y no olviden que hay que revisar el coche, mi suegra siempre... 
Es suicida el tipo.

@YuriCosta_91 @monicabergamo Desculpa mas não existe fala preconceituosa quando se está diante de um fato desses.

A morte do cara não foi acidental, o cara matou porque quis. E vc vem me falar de preconceito ?

Mano, na boa, volta de Nárnia que cê tá viajando.
